    // body supports embedded HTML tags - the data will not be formatted if you don't provide structure
    '_t.file-mapper.specifications.nacha.guidelines_body': '<ul><li>You can import a balanced NACHA format file to create an ACH Batch, ACH Collection, or Payroll payment<ul><li>NACHA files are not processed as uploaded into the system. The system is extracting the information (Routing Number, Account Number, Amount(s), Effective Date, SEC Code, and Subsidiary/Originator) needed to create an ACH Payments, ACH Collections, or ACH Payroll Online Banking transaction. To upload a NACHA file and have it processed as uploaded, please use ACH PassThru</li><li>Classifying the payment as PPD or CCD, selecting Pay From/Pay To account, selecting a Subsidiary, and selecting an Effective date should not be necessary as that info should be in the balanced file</li></ul></li><li>The import uses the name and the order of the file to create recipients and amounts</li><li>You can include a recipient multiple times to create multiple payments</li><li>The payments can be to the same account or a different account</li></ul>',

