    // body supports embedded HTML tags - the data will not be formatted if you don't provide structure
    '_t.upload.achcollection.guidelines_body': '<ul><li>You can import a list of recipients and amounts from a 5-column Comma Separated Values (CSV) file to add recipients and amounts to a new ACH Batch, or ACH Collection, or Payroll<ul><li>The CSV file must contain the following columns: Recipient name, Routing transit number, Account number, Account type, & Amount</li><li>Account Type is a numeric value: Checking = 1; Savings = 2; & Loan = 3 </li><li>For 5-column imports, you will be prompted to select a SEC code, select a Pay From/Pay to account, select a Subsidiary (where applicable), and select an effective date</li></ul></li></ul><div class=\'pad-V-md mrg-B-sm\'><strong>OR</strong></div><ul><li>You can import a balanced NACHA format file to create an ACH Batch, or ACH Collection, or Payroll payment<ul><li>NACHA files are not processed as uploaded into the system. The system is extracting the information (Routing Number, Account Number, Amount(s), Effective Date, SEC Code, and Subsidiary/Originator) needed to create an ACH Payments, ACH Collections, or ACH Payroll Online Banking transaction. To upload a NACHA file and have it processed as uploaded, please use ACH PassThru.</li><li>Classifying the payment as PPD or CCD, selecting Pay From/Pay To account, selecting a Subsidiary, and selecting an Effective date should not be necessary as that info should be in the balanced file</li></ul></li><li>The import uses the name and the order of the file to create recipients and amounts</li><li>You can include a recipient multiple times to create multiple payments</li><li>The payments can be to the same account or a different account</li>',
