    '_t.settings.alerts.delivery.termsSummary': "<p>Q2 Text Banking - Short Code 86434</p><h2>Program Description</h2><p>Q2 Text Banking allows our financial institutions' customers to opt-in to receive two-factor authentication codes as well as receive account information for their banking accounts from Q2.</p><h2>Supported Carriers</h2><p>AT&T, Boost Mobile, MetroPCS, Sprint PCS, T-Mobile, U.S. Cellular, Verizon Wireless, Virgin Mobile and select regional carriers within ACG, Interop Technologies, and ClearSky Technologies, but is not compatible with all handsets. T-Mobile is not liable for delayed or undelivered messages.</p><h2>Cost</h2><p>There are no premium charges using Q2 Text Banking. Message and data rates may apply.</p><h2>Message Frequency</h2><p>Subscribers to Q2 Text Banking will receive one message per query.</p><h2>How to opt-out</h2><p>To opt-out of Q2 Text Banking, reply STOP to 86434. An unsubscribe message will be sent to your number confirming the cancellation, but no more messages will be sent after that one.</p><h2>Support/Help</h2><p>For support or information about Q2 Text Banking, reply HELP to 86434. Optionally, you may email us at <a href='mailto:support@onlineaccess1.com'>support@onlineaccess1.com</a>.</p><h2>Privacy Policy</h2><p>Information concerning data privacy may be found in the privacy policy of your financial institution. If you have any questions, please send an email to <a href='mailto:support@onlineaccess1.com'>support@onlineaccess1.com</a>.</p>",
